import{_ as i}from"./plugin-vue_export-helper-c27b6911.js";import{o as e,c as a,f as d}from"./app-777bfcd9.js";const l="/assets/note/qccstp/政府信息化与电子政务.png",t="/assets/note/qccstp/企业信息化与电子商务-企业资源计划-1.png",r="/assets/note/qccstp/企业信息化与电子商务-企业资源计划-2.png",c="/assets/note/qccstp/企业信息化与电子商务-供应链管理.png",o="/assets/note/qccstp/企业信息化与电子商务-数据仓库.png",n="/assets/note/qccstp/企业信息化与电子商务-决策支持系统.png",h="/assets/note/qccstp/企业信息化与电子商务-业务流程重组.png",s="/assets/note/qccstp/企业信息化与电子商务-表示集成.png",p="/assets/note/qccstp/企业信息化与电子商务-数据集成.png",u="/assets/note/qccstp/企业信息化与电子商务-控制集成.png",b={},f=d('<h2 id="信息与信息化的概念" tabindex="-1"><a class="header-anchor" href="#信息与信息化的概念" aria-hidden="true">#</a> 信息与信息化的概念</h2><h3 id="信息的定义" tabindex="-1"><a class="header-anchor" href="#信息的定义" aria-hidden="true">#</a> 信息的定义</h3><ol><li>香农：信息就是不确定性的减少</li><li>维纳：信息就是信息，既不是物质，也不是能量</li></ol><h3 id="信息的特点" tabindex="-1"><a class="header-anchor" href="#信息的特点" aria-hidden="true">#</a> 信息的特点</h3><ul><li>客观性（真伪性）：也叫事实性，不符合事实的信息不仅没价值，还有副作用</li><li>动态性：信息随着时间的变化而变化</li><li>层次性：信息可以分为战略级、管理级和操作级</li><li>传递性：信息在<code>时间上的传递即是存储</code>；在<code>空间上的传递即是转移或扩散</code></li><li>滞后性：信息是数据加工后的产物，所以相对数据有滞后性</li><li>扩压性：信息和实物不同，它可以扩散也可以压缩</li><li>分析性：信息可以分享，这和物质不同，并且信息分享具有非零和性</li></ul><h3 id="信息化及其意义" tabindex="-1"><a class="header-anchor" href="#信息化及其意义" aria-hidden="true">#</a> 信息化及其意义</h3><h4 id="信息化的概念" tabindex="-1"><a class="header-anchor" href="#信息化的概念" aria-hidden="true">#</a> 信息化的概念</h4><ul><li>信息化是从<code>工业社会到信息社会的演进与变革</code></li><li>信息化的主体是全体社会成员（政府、企业、团体和个人），时域是一个长期过程，空域是经济和社会的一切领域，手段是先进社会生产工具</li></ul><h4 id="信息化对组织的意义" tabindex="-1"><a class="header-anchor" href="#信息化对组织的意义" aria-hidden="true">#</a> 信息化对组织的意义</h4><ul><li>组织的结构创新：如虚拟企业、虚拟社区</li><li>组织的管理创新：实施电子政务、建立电子政府、建立电子社区以提升管理水平</li><li>组织经营创新：利用信息化将经营和管理融为一体</li><li>造就信息化人才队伍：三类人才（IT 专才、业务人才、专家型人才）</li></ul><h2 id="信息系统生命周期" tabindex="-1"><a class="header-anchor" href="#信息系统生命周期" aria-hidden="true">#</a> 信息系统生命周期</h2><ul><li>立项阶段：企业全局、形成概念、需求分析</li><li>开发阶段：单个系统开发（总体规划 → 系统分析 → 系统设计 → 系统实施 → 系统验收）</li><li>运维阶段：通过验证、移交之后</li><li>消亡阶段：更新改造、功能拓展、报废重建</li></ul><table><thead><tr><th>阶段</th><th>工作</th><th>产出</th></tr></thead><tbody><tr><td>系统规划</td><td>初步调查、分析系统目标、子系统组成、拟实施方案、可行性研究、指定系统建设方案</td><td>系统设计任务书（系统建设方案、实施计划）</td></tr><tr><td>系统分析</td><td>业务流程分析、数据与数据流程分析、软件需求分析、网络需求分析</td><td>系统需求规格说明书、软件需求规格说明书、确定测试计划、系统测试计划、初步的用户手册</td></tr><tr><td>系统设计</td><td>软件架构设计、软件概要设计、详细设计、网络设计</td><td>架构设计文档、概要设计说明书、详细设计说明书、程序规格说明书、概要测试计划、详细测试计划、各类设计图</td></tr><tr><td>系统实施</td><td>软件编码、软件单元/集成/刺痛测试、综合布线</td><td>源码、单元测试、集成测试报告、操作手册</td></tr><tr><td>系统验收</td><td>确认测试、试运行</td><td>确认测试报告、项目验收报告</td></tr></tbody></table><h2 id="信息系统战略规划" tabindex="-1"><a class="header-anchor" href="#信息系统战略规划" aria-hidden="true">#</a> 信息系统战略规划</h2><h3 id="方法" tabindex="-1"><a class="header-anchor" href="#方法" aria-hidden="true">#</a> 方法</h3><table><thead><tr><th>阶段</th><th>方法</th></tr></thead><tbody><tr><td>第一阶段 <br> <code>以数据处理为核心</code>，围绕只能部门需求</td><td>企业系统规划法（<code>BSP</code>）：<code>自上而下</code>识别系统目标，自下而上设计信息系统，对组织机构的变动具有适应性 <br> 关键成功因素法（<code>CSF</code>）:找实现目标的<code>关键信息集合，从而确定开发优先次序</code> <br> 战略集合转化法（<code>SST</code>）：把战略目标看成<code>&quot;信息集合&quot;，把战略目标转变成信息系统的战略目标</code></td></tr><tr><td>第二阶段 <br> <code>以企业内部MIS为核心</code>，围绕企业整体需求</td><td>战略数据规划法（<code>SDP</code>）、信息工程法（<code>IE</code>）、战略栅格法（<code>SG</code>）</td></tr><tr><td>第三阶段 <br> 综合考虑企业内外环境，<code>以集成为核心</code>，围绕企业战略需求</td><td>价值链分析法（VCA）、战略一致性模型（SAM）</td></tr></tbody></table><div class="hint-container tip"><p class="hint-container-title">企业战略模型</p><p>企业战略数据模型分为数据库模型和数据仓库模型，数据库模型用来描述日常事务处理中的数据及其关系；数据仓库模型则描述企业高层管理决策者所需信息及其联系。在企业信息化过程中，数据库模型是基础，一个好的数据库模型一个客观地反映企业生产经营的内在联系。数据库是办公自动化】计算机辅助管理系统、开发与设计自动化、生产过程自动化、Intranet 的基础和环境</p></div><h2 id="政府信息化与电子政务" tabindex="-1"><a class="header-anchor" href="#政府信息化与电子政务" aria-hidden="true">#</a> 政府信息化与电子政务</h2><figure><img src="'+l+'" alt="政府信息化与电子政务" tabindex="0" loading="lazy"><figcaption>政府信息化与电子政务</figcaption></figure><h2 id="企业信息化与电子商务" tabindex="-1"><a class="header-anchor" href="#企业信息化与电子商务" aria-hidden="true">#</a> 企业信息化与电子商务</h2><h3 id="企业资源计划-erp" tabindex="-1"><a class="header-anchor" href="#企业资源计划-erp" aria-hidden="true">#</a> 企业资源计划（ERP）</h3><ul><li>物料需求计划（Material Requirement Planning, MRP）：物料单系统</li><li>制造资源计划（Manufacturing Resource Planning, MRPⅡ）：增加库存、分销等等</li><li>企业资源计划（Enterprise Resource Planning, ERP）：打通了供应链、把财务、人力资源、销售管理等纳入</li></ul><br><ul><li>管理思想：他是管理思想的变革</li><li>软件产品：但不是直接买来就用，需要个性化开发与部属</li><li>管理系统：存在众多的子系统，这些子系统有统一的规划，是<code>互联互通的，便于事前事中监控</code></li></ul><figure><img src="'+t+'" alt="企业信息化与电子商务-企业资源计划-1" tabindex="0" loading="lazy"><figcaption>企业信息化与电子商务-企业资源计划-1</figcaption></figure><figure><img src="'+r+'" alt="企业信息化与电子商务-企业资源计划-2" tabindex="0" loading="lazy"><figcaption>企业信息化与电子商务-企业资源计划-2</figcaption></figure><h3 id="客户关系管理-crm" tabindex="-1"><a class="header-anchor" href="#客户关系管理-crm" aria-hidden="true">#</a> 客户关系管理（CRM）</h3><p>市场营销和客户服务是 CRM 的支柱性功能。通过维护客户关系，让企业获得利益</p><ul><li>客户服务与支持</li><li>客户群维系</li><li>商机管理</li></ul><br><ul><li>触发中心</li><li>挖掘中心</li></ul><br><ul><li>自动化销售</li><li>自动化市场营销</li><li>自动化客户服务</li></ul><h3 id="供应链管理-scm" tabindex="-1"><a class="header-anchor" href="#供应链管理-scm" aria-hidden="true">#</a> 供应链管理（SCM）</h3><p><code>SCM理念</code>：强强联合，整合与优化&quot;三流&quot;，打通企业间&quot;信息孤岛&quot;，严格的数据交换标准</p><figure><img src="'+c+'" alt="企业信息化与电子商务-供应链管理" tabindex="0" loading="lazy"><figcaption>企业信息化与电子商务-供应链管理</figcaption></figure><p><code>信息化的三流</code></p><ul><li>信息流 <ul><li>需求信息流（需方到供方）：如客户订单、生产计划、采购合同等</li><li>供应信息流（供方到需方）：如入库单、完工报告单、库存计划、可供销售量、提货发运单等</li></ul></li><li>资金流</li><li>物流</li></ul><h3 id="产品数据管理" tabindex="-1"><a class="header-anchor" href="#产品数据管理" aria-hidden="true">#</a> 产品数据管理</h3><h3 id="商业智能-bi" tabindex="-1"><a class="header-anchor" href="#商业智能-bi" aria-hidden="true">#</a> 商业智能（BI）</h3><ul><li>需求分析</li><li>数据仓库建模</li><li>数据抽取</li><li>建立 BI 分析报表</li><li>用户培训和数据模拟测试</li><li>系统改进和完善</li></ul><p>总结：<mark>数据仓库、数据挖掘、OLAP（联机分析处理）</mark></p><blockquote><ul><li>数据库 → 主要组偶高并发<code>事务处理</code> -- OLTP（联机事务处理）</li><li>数据仓库 → 主要做<code>决策处理</code> -- OLAP</li></ul></blockquote><ul><li>商业智能、大数据、数据挖掘</li></ul><h4 id="数据仓库" tabindex="-1"><a class="header-anchor" href="#数据仓库" aria-hidden="true">#</a> 数据仓库</h4><p>特点：</p><ul><li><code>面对主题</code>：数据按主题组织</li><li><code>集成的</code>：消除了数据源中的不一致性，提供整个企业的一致全局信息</li><li><code>相对稳定的（非易失的）</code>：主要进行查询操作，只有少量的修改和删除操作（或不是删除）</li><li><code>反映历史变化（随着时间变化）</code>：记录企业从过去某一时刻到当前各个阶段的信息，可对发展历程和未来趋势做定量分析和预测</li></ul><figure><img src="'+o+'" alt="企业信息化与电子商务-数据仓库" tabindex="0" loading="lazy"><figcaption>企业信息化与电子商务-数据仓库</figcaption></figure><h4 id="数据挖掘" tabindex="-1"><a class="header-anchor" href="#数据挖掘" aria-hidden="true">#</a> 数据挖掘</h4><p>方法</p><ul><li>决策树（构造树结构进行分析）</li><li>神经网络（类似统计学中的判别、回归、聚类等功能）</li><li>遗传算法（三个基本过程：繁殖（选择）、交叉（重组）、变异（交叉））</li><li>关联规则挖掘算法（关联规则是描述数据之间存在的关系的规则）</li></ul><p>分类</p><ul><li>关联分析：挖掘出隐藏在数据间的相互关系</li><li>序列模式分析：侧重点是分析数据间的前后关系（因果关系）</li><li>分类分析：为每一个记录赋予一个标记再按标记分类</li><li>聚类分析：分类分析法的逆过程</li></ul><h4 id="数据湖" tabindex="-1"><a class="header-anchor" href="#数据湖" aria-hidden="true">#</a> 数据湖</h4><p><code>数据湖</code>是一个存储企业各种各样原始数据的大型仓库，其中的数据可供存取、处理、分析与传输</p><p>数据湖从企业的多个数据源获取原始数据，并且针对不同的目的，同一份原始数据还有可能有多种满足特定内部模型格式的数据副本。因此，数据湖中被处理的数据可能是任意类型的信息，<code>从结构化数据到完全非结构化数据</code></p><p><code>数据仓库仅支持分析处理；数据湖既支持分析处理，也支持事务处理</code></p><table><thead><tr><th>维度</th><th>数据仓库</th><th>数据湖</th></tr></thead><tbody><tr><td>数据</td><td>清洗过的数据<br>结构化的数据</td><td>原始数据<br>结构化、半结构化数据</td></tr><tr><td>模式</td><td>数据存储之前定义数据模式<br>数据集成之前完成大量工作<br>数据的价值提前明确</td><td>数据存储之后定义数据模式<br>提供敏捷，简单的数据集成<br>数据的价值尚未明确</td></tr><tr><td>存取方法</td><td>标准 SQL 语言</td><td>应用程序，类 SQL 的程序</td></tr><tr><td>优势</td><td>多数据源集成<br>干净，安全的数据<br>转换一次，多次使用</td><td>无限扩展<br>并行执行<br>支持编程框架<br>数据经济</td></tr></tbody></table><h3 id="决策支持系统-dss" tabindex="-1"><a class="header-anchor" href="#决策支持系统-dss" aria-hidden="true">#</a> 决策支持系统（DSS）</h3><figure><img src="'+n+'" alt="企业信息化与电子商务-决策支持系统" tabindex="0" loading="lazy"><figcaption>企业信息化与电子商务-决策支持系统</figcaption></figure><h3 id="知识管理" tabindex="-1"><a class="header-anchor" href="#知识管理" aria-hidden="true">#</a> 知识管理</h3><h3 id="业务流程重组-bpr" tabindex="-1"><a class="header-anchor" href="#业务流程重组-bpr" aria-hidden="true">#</a> 业务流程重组（BPR）</h3><p>BPR 是对企业的业务<code>流程</code>进行<code>根本性</code>的再思考和<code>彻底性的再设计</code>，从而获得可以用诸如成本、质量、服务和速度方面的业绩来衡量的<code>显著性</code>的成就</p><figure><img src="'+h+'" alt="企业信息化与电子商务-业务流程重组" tabindex="0" loading="lazy"><figcaption>企业信息化与电子商务-业务流程重组</figcaption></figure><h3 id="业务流程管理-bpm" tabindex="-1"><a class="header-anchor" href="#业务流程管理-bpm" aria-hidden="true">#</a> 业务流程管理（BPM）</h3><p>BPM 是一种以<code>规范化</code>的构造端到端的卓越业务<code>流程</code>为中心，以<code>持续的</code>提高组织业务绩效为目的的<code>系统化</code>方法</p><p><code>PDCA</code>闭环的管理过程</p><ul><li>明确业务流程所欲获取的成果</li><li>开发和计划系统的方法，实现以上成果</li><li>系统地部署方法，确保全面实施</li><li>根据对业务的检查和分析以及持续的学习活动，评估和审查所执行的方法。并进一部提出计划和实施改进措施</li></ul><blockquote><p>PDCA: 即 plan → do → check → action cycle, 称作<code>戴明环</code></p></blockquote><ul><li>BPM 与 BPR 管理思想最根本的不同就在于流程管理并不要求对所有的流程进行再造。构造卓越的业务流程并不是流程再造，而是根据现有的流程的具体情况，对流程进行规范化的设计</li><li>流程管理包含三个层面：规范流程、优化流程和再造流程</li></ul><h3 id="电子商务" tabindex="-1"><a class="header-anchor" href="#电子商务" aria-hidden="true">#</a> 电子商务</h3><p>电子商务的形式：</p><ul><li>企业对消费者（B2C）</li><li>企业对企业（B2B）</li><li>消费者对消费者（C2C）</li><li>线上对线下（O2O） --- online to offline</li></ul><h3 id="企业应用集成-eai" tabindex="-1"><a class="header-anchor" href="#企业应用集成-eai" aria-hidden="true">#</a> 企业应用集成（EAI）</h3><p>企业应用集成（Enterprise Application Integration，EAI）构建统一标准的基础平台，将进程、软件、标准和硬件联合起来，连接具有不同功能和目的而又独立运行的企业内部的应用系统，以达到信息和流程的共享，使企业相关应用整合在一起</p><p>EAI 必须遵循如下原则：</p><ul><li>应用程序的独立性</li><li>面向商业流程</li><li>独立于技术</li><li>平台无关</li></ul><p>EAI 提供 4 个层次的服务，从上至下依次为通信服务、信息传递与转化服务、应用连接服务、流程控制服务</p><ul><li>企业内部的信息集成 <ul><li>技术平台的集成：系统底层的体系结构、软件、硬件以及异构网络的特殊需求首先必须得到集成</li><li>数据的集成：为了完成应用集成和业务流程集成，需要解决数据和数据库的继承问题。数据集成的目的是实现不同系统的数据交流与共享，是进行其他更进一步集成的基础</li><li>应用系统的集成：实现不同系统之间的互操作，<code>使得不同应用系统之间能够实现数据和方法的共享</code></li><li>业务过程的集成：<code>企业必须在各种业务系统中定义、授权和管理各种信息的交换</code>，实现流程的协调运作和流程信息的充分共享</li></ul></li><li>企业外部的信息集成 <ul><li>门户网站</li><li>合作伙伴信息系统的对接</li></ul></li></ul><p>集成管理是企业信息资源管理的主要内容之一。实行企业信息资源集成的前提是对企业历史上形成的企业信息功能的集成，其核心是对企业内部和外部的信息流的集成，其实施的基础是各种信息手段的集成。通过集成管理实现企业信息系统各要素的优化组合，使信息系统各要素之间形成强大的协同作用，从而最大限度的放大企业信息的功能，实现企业可持续发展的目的</p><p>集成支持的方式：面向信息的集成 → 面向过程的集合 → 面向服务的集成</p><ul><li>面向信息的集成：针对信息孤岛问题，实现方法包括：数据复制、数据捆绑和基于接口的信息集成三种方式</li><li>面向过程的集成：技术层面的过程集成，引入工作流引擎。业务过程逻辑和用用逻辑分离，实现过程建模和数据、功能的分离</li><li>面向服务的集成：针对大范围内的公共业务过程集成。较好地实现企业间具有松散耦合关系的不同应用间的互操作</li></ul><h4 id="表示集成-界面集成" tabindex="-1"><a class="header-anchor" href="#表示集成-界面集成" aria-hidden="true">#</a> 表示集成（界面集成）</h4><p>把各应用系统界面集成起来，统一入口，使用户能够对集成系统<mark>产生一个&quot;整体&quot;的感觉</mark></p><figure><img src="'+s+'" alt="企业信息化与电子商务-表示集成" tabindex="0" loading="lazy"><figcaption>企业信息化与电子商务-表示集成</figcaption></figure><h4 id="数据集成" tabindex="-1"><a class="header-anchor" href="#数据集成" aria-hidden="true">#</a> 数据集成</h4><p>数据集成是应用集成和业务过程集成的基础。<mark>把不同来源、格式、特点性质的数据在逻辑上或物理上有机地集中</mark>，从而为企业提供全面的数据共享</p><p>在集成时通过判断是数据库的单表还是多表进行数据整合（简记：单表主动记录，多表数据映射）：</p><ul><li>如果是单表即可完成整合，则可以将该表报装为记录，采用主动记录的方式进行集成</li><li>如果是多表进行数据整合，则需要采用数据映射的方式完成数据集成与处理</li></ul><p>数据集成主要有以下三种模式</p><ul><li>数据联邦：数据联邦是指不用应用共同访问一个全局的虚拟数据库，通过全局数据库管理系统为不同应用提供全局信息服务，实现不同应用和数据源之间的信息共享和数据交换，其具体实现由客户端应用、全局信息服务和若干个局部数据源三部分组成</li><li>数据复制模式：通过底层数据源之间的一致性复制来实现（访问不同数据库的）不同应用之间的信息共享和互操作，其实现的关键是必须能够提供在两个或多个数据库之间实现数据转换和传输的基础结构（以屏蔽不同数据库见数据模型的差异）</li><li>基于接口的数据集成模式：不同应用系统之间利用适配器（或接口代理）提供的应用编程接口来实现相互调用。应用适配器或接口代理通过其开放或私有接口将业务信息从其所封装的具体应用系统中提取出来，进而实现不同应用系统之间业务数据的共享与互交换。接口调用方式可以采用同步调用方法，也可以采用消息中间件的异步方法来实现</li></ul><figure><img src="'+p+'" alt="企业信息化与电子商务-数据集成" tabindex="0" loading="lazy"><figcaption>企业信息化与电子商务-数据集成</figcaption></figure><h4 id="应用集成-控制集成、api-集成" tabindex="-1"><a class="header-anchor" href="#应用集成-控制集成、api-集成" aria-hidden="true">#</a> 应用集成（控制集成、API 集成）</h4><p>业务逻辑层次集成，可以借助于<mark>远程过程调用或远程方法调用、面向消息的中间件等技术</mark></p><figure><img src="'+u+'" alt="企业信息化与电子商务-控制集成" tabindex="0" loading="lazy"><figcaption>企业信息化与电子商务-控制集成</figcaption></figure><h4 id="业务流程集成-过程集成、b2b" tabindex="-1"><a class="header-anchor" href="#业务流程集成-过程集成、b2b" aria-hidden="true">#</a> 业务流程集成（过程集成、B2B）</h4><p>进行业务流程集成时，<mark>企业比必须对各种业务信息的交换进行定义</mark>、授权和管理，一边改进操作、减少成本、提高响应速度</p><ul><li><strong>消息集成</strong>：适用于数据量小、但要求频繁地、立即地、<code>异步地</code>数据交换场合</li><li><strong>共享数据库</strong>：实时性强、可以频繁交互，数据的交换属于<code>同步方式</code></li><li><strong>文件传输</strong>：使用于数据量大、交换频度小、即时性要求低的情况</li></ul><h4 id="集成平台" tabindex="-1"><a class="header-anchor" href="#集成平台" aria-hidden="true">#</a> 集成平台</h4><p>集成平台是支持企业集成的支撑环境，包括硬件、软件、软件工具和系统，通过集成各种企业应用形成企业集成系统</p><ul><li>通信服务：提供分布环境下透明的同步/异步通信服务功能</li><li>信息集成服务：<code>为应用提供透明的信息访问服务，通过实现异种数据库系统之间的数据交换、互操作、分布数据管理和共享信息模型定义</code>，使平台上的应用、服务或用户能够以一致的语义和接口实现对数据的访问与控制</li><li>应用集成服务：<code>通过高层应用变成接口来实现对相应应用程序的访问，这些高层应用编程接口包含在不同的适配器或代理中，它们被用来连接不同的应用程序</code>，通过为应用提供数据交换和访问操作，使各种不同的系统能够相互协作</li><li>二次开发平台：简化用户在企业集成平台实施过程中的开发工作</li><li>平台运行管理工具：是集成平台的运行管理和控制模块</li></ul><div class="hint-container tip"><p class="hint-container-title">共享数据库</p><p>共享数据库是一种重要的企业集成方式。它通常将应用程序的数据存储在一个共享数据库中，通过制定统一的数据库模式来处理不同应用的集成需求。共享数据库为不同的应用程序提供了统一的数据存储与格式定义，能够在一定程度上缓解语义不一致的问题（但无法完全解决该问题）。在共享数据库集成中，多个应用程序可能通过共享库频繁的读取和修改相同的数据，这会使数据库成为一个性能瓶颈。共享数据库集成方式的一个重要限制来自外部的已封装应用，这些封装好的应用程序只能采用自己定义的数据库模式，调整和集成的余地较小</p></div><h3 id="企业门户" tabindex="-1"><a class="header-anchor" href="#企业门户" aria-hidden="true">#</a> 企业门户</h3><ul><li><code>企业网站</code>：注重单向信息传递，缺互动</li><li><code>企业信息门户（EIP）</code>：把各种应用系统、数据资源和互联网资源统一集成到企业门户之下</li><li><code>企业知识门户（EKP）</code>：企业网站的基础上增加<code>知识性内容</code></li><li><code>企业应用门户（EAP）</code>：实际上是对企业业务流程的集成。它以<code>业务流程和企业应用为核心</code>，把业务流程中功能不同的应用模块通过门户技术集成在一起</li><li><code>企业通用门户</code>：集以上四者于一身</li></ul>',104),g=[f];function m(x,_){return e(),a("div",null,g)}const y=i(b,[["render",m],["__file","enterprise-informatization-strategy-and-implementation.html.vue"]]);export{y as default};
